import React from 'react';
import './App.css';
import Particles from 'react-particles-js';
import logo from './assets/logo.png'
import About from './About.js'
import Skills from './Skills.js'

const particleParams = {
  particles: {
          number: {
              value: 80,
              density: {
                  enable: true,
                  value_area: 1500
              }
          },
          line_linked: {
              enable: true,
              opacity: 0.05
          },
          move: {
              direction: "right",
              speed: 0.1
          },
          size: {
              value: 1
          },
          opacity: {
              anim: {
                  enable: true,
                  speed: 1.5,
                  opacity_min: 0.05
              }
          }
      },
      interactivity: {
          events: {
              onhover: {
                  enable: true,
                  mode: "repulse"
              }
          },
          modes: {
              repulse: {
                  distance: 50
              }
          },
      },
      retina_detect: true
}

function App() {
  return (
    <>
      <div className = "divStyle">

        <div className = "h2divStyle">
          <a href="#Skills" className = "h2Style">EXPERIENCE</a>
        </div>
        <div className = "h2divStyle">
           <a href="link here" className = "h2Style">PROJECTS</a>
        </div>
        <div className = "h2divStyle">
          <a href="#About" className = "logoButton">
          <img className = "logo" 
           src = {logo}
          />
          </a>
        </div>
        <div className = "h2divStyle">
          <a href="link here" className = "h2Style">ART</a>
        </div>
        <div className = "h2divStyle">
          <a href="link here" className = "h2Style">CONTACT</a>
        </div>
      </div>
      <div className = "content">
        <Particles className = "particles"
         params = {particleParams}/>
        <About/>
        <Skills/>
      </div>
    </>

  );
}

export default App;
